    const [register, setRegister] = useState(false);
    const [login, setLogin] = useState(false);

    const registerHandler = () => {
        setRegister(!login)
    }

    const loginHandler = () => {
        setLogin(!login)
    }



    return (
        <>
            <div className="user">
                <div className="userLogin">
                    <div className="loginDetails">
                        <span className="loginTitle">Bienvenido,
                            carnavalero</span>
                    </div>
                    {login != true && <div className="loginSubtitle"><span>See all the new features we’ve added through our tutorial.</span>
                        <span>See all the new features we’ve added through our tutorial.</span></div>}



